import React, { useState, useEffect } from 'react';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';

const ProductForm = ({ initialData = {}, onSave, onCancel }) => {
  const [productData, setProductData] = useState({
    name: '',
    description: '',
    stock: 0,
    price: 0,
    purchase_price: 0,
    category: '',
    supplier_id: '',
    img: ''
  });

  useEffect(() => {
    if (initialData) {
      setProductData(initialData);
    }
  }, [initialData]);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setProductData({
      ...productData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSave(productData); // Guarda el producto
    resetForm();
  };

  const resetForm = () => {
    setProductData({
      name: '',
      description: '',
      stock: 0,
      price: 0,
      purchase_price: 0,
      category: '',
      supplier_id: '',
      img: ''
    });
    onCancel(); // Cancela la edici√≥n (si es aplicable)
  };

  return (
    <Form className='my-3' onSubmit={handleSubmit}>
      <Row className='justify-content-center'>
        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-name">Nombre</Form.Label>
          <Form.Control
            type='text'
            id="product-name"
            name="name"
            placeholder='Nombre'
            value={productData.name}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-description">Descripci√≥n</Form.Label>
          <Form.Control
            type='text'
            id="product-description"
            name="description"
            placeholder='Descripci√≥n'
            value={productData.description}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-stock">Stock</Form.Label>
          <Form.Control
            type='number'
            id="product-stock"
            name="stock"
            placeholder='Stock'
            value={productData.stock}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-price">Precio</Form.Label>
          <Form.Control
            type='number'
            id="product-price"
            name="price"
            placeholder='Precio'
            value={productData.price}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-img">Imagen (URL)</Form.Label>
          <Form.Control
            type='text'
            id="product-img"
            name="img"
            placeholder='Imagen URL'
            value={productData.img}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-purchase-price">Precio de Compra</Form.Label>
          <Form.Control
            type='number'
            id="product-purchase-price"
            name="purchase_price"
            placeholder='Precio de Compra'
            value={productData.purchase_price}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-category">Categor√≠a</Form.Label>
          <Form.Control
            type='text'
            id="product-category"
            name="category"
            placeholder='Categor√≠a'
            value={productData.category}
            onChange={handleChange}
          />
        </Form.Group>

        <Form.Group className="mb-3 col-4">
          <Form.Label htmlFor="product-supplier-id">ID del Proveedor</Form.Label>
          <Form.Control
            type='text'
            id="product-supplier-id"
            name="supplier_id"
            placeholder='ID del Proveedor'
            value={productData.supplier_id}
            onChange={handleChange}
          />
        </Form.Group>
      </Row>
      <Button className='btn-primary' type="submit">
        {initialData.id ? 'Actualizar Producto' : 'Agregar Producto'}
      </Button>
      {initialData.id && (
        <Button className='btn-secondary ml-2' onClick={resetForm}>
          Cancelar
        </Button>
      )}
    </Form>
  );
};

export default ProductForm;
